import Vue from "vue";
import VueRouter from "vue-router";

import LoginAdd from "../views/LoginAdd.vue";

Vue.use(VueRouter);

const routes = [{
  path: "/",
  name: "loginAdd",
  component: LoginAdd,
} ];

const router = new VueRouter({
  mode: "history",
  base: process.env.BASE_URL,
  routes,
});

export default router;
